import "./Home.css";
import React from 'react';
const Mobile = (props) => {

    return (

        <div className="mobile-specs">

            <div className="mobile-image"><img src={props.image} /></div>
            <div className="mobile-info"><h2>{props.title}</h2>
                <p className="mobile-brand">{props.brand}</p>
                <p className="mobile-price">${props.price}</p>
                <button>Buy Now</button>
            </div>
        </div>
    )
}

export default Mobile;
